            if (optgroup.label.startsWith('Light Weapons - Daggers')) {
                optgroup.style.color = '#ffd700';             } else {
                optgroup.style.color = '#ffd700';             }
            optgroup.style.fontWeight = 'bold';
            
                        const options = optgroup.querySelectorAll('option');
