                    const option = document.createElement('option');
                    option.value = JSON.stringify(weapon);
                    option.textContent = weapon.name;
                    optgroup.appendChild(option);
                });
                select.appendChild(optgroup);
            });
        });
    });
    applyWeaponCategoryStyle();
}

